// src/services/pacienteService.js
import axios from 'axios';

const API_URL = 'http://localhost:8080/paciente/crud/addPaciente'; // Substitua pela sua URL

export const cadastrarPaciente = async (pacienteData) => {
    try {
      const response = await axios.post(API_URL, pacienteData);
      return response.data; // Retorne os dados da resposta
    } catch (error) {
      // Verifique se o erro tem uma resposta
      const message = error.response?.data?.message || error.message || 'Erro desconhecido';
      throw new Error('Erro ao cadastrar paciente: ' + message); // Capture a mensagem de erro
    }
  };
